import React from 'react';
import { useSelector } from 'react-redux';
import Product from './Product'; // Assume a Product component for individual products

const ProductListComponent = () => {
    const { products, priceRange } = useSelector(state => ({
        products: state.products.items, // Adjust according to your state structure
        priceRange: state.product.priceRange
    }));

    // Filter products based on the price range
    const filteredProducts = products.filter(product =>
        product.price >= priceRange[0] && product.price <= priceRange[1]
    );

    return (
        <div>
            {filteredProducts.map(product => <Product key={product.id} {...product} />)}
        </div>
    );
};

export default ProductListPriceComponent;
